// Home.js

import React from 'react';
import { Link } from 'react-router-dom';

function Home({ isLoggedIn }) {
  return (
    <div className="Home">
      <h1>메인 화면입니다.</h1>
      {isLoggedIn && ( // 로그인 상태일 때만 메뉴바를 표시
        <nav className="Menu">
          <ul>
            <li>
              <Link to="/">홈</Link>
            </li>
            <li>
              <Link to="/about">소개</Link>
            </li>
            <li>
              <Link to="/contact">연락</Link>
            </li>
          </ul>
        </nav>
      )}
    </div>
  );
}

export default Home;
